import React from 'react';
import { Link } from "react-router-dom";

function ScroeBoard() {
    return (`
        <div>
            <h1>ScroeBoard</h1>
        </div>
        <div>
            <Link to="/">Back</Link>
        </div>
    `);
  }
export default ScroeBoard;
